import './App.css';

function NumberList(props) {
  const numbers = props.numbers;
  const listItems = numbers.map((number) =>
    <li>{number}</li>
  );
  return (
    <ul>{listItems}</ul>
  );
}

const numbers = [1, 2, 3, 4, 5];

function App(props) {
  return (
    <div className="App">
      <header className="App-header">
        <NumberList numbers={numbers} />;
      </header>
    </div>
  );
}


export default App;
